function History({ history }) {
  const historyItemList = history.map((item, index) => {
    return (
      <p>
        {' '}
        This is step {index + 1} : {item}
      </p>
    );
  });
  return (
    <div>
      <h2 className="history-title">History</h2>
      <ul className="history-list">{historyItemList}</ul>
    </div>
  );
}
export default History;
